INSERT [dbo].[T109_ESTADOCITA] ([codEstadoCita], [estado], [origen]) VALUES (N'E6', N'ANULADO', N'se genera cuando el paciente no asiste a su cita (consulta) y no ha realizado pago)')
INSERT [dbo].[T109_ESTADOCITA] ([codEstadoCita], [estado], [origen]) VALUES (N'E7', N'ABANDONADO', N'se genera cuando el paciente no asiste a su cita (consulta) pese a haberla pagado)')

